"G1058": "<span class=\"literal-meaning\">Gallio = &quot;One who lives on milk&quot;</span><ol><li> Junius Annaeus Gallio, the Roman proconsul of Achaia when Paul was at Corinth, 53 A.D., under the emperor Claudius. Acts 18:12. He was brother to Jucius Annaeus Seneca, the philosopher. Jerome in the Chronicle of Eusebius says that he committed suicide in 65 A.D. Winer thinks he was put to death by Nero.</li></ol>",
"G1059": "<span class=\"literal-meaning\">Gamaliel = &quot;my recompenser is God&quot;</span><ol><li> a Pharisee and celebrated doctor of the law, who gave prudent worldly advice in the Sanhedrin respecting the treatment of the followers of Jesus of Nazareth. Acts 5:34 ff. (A.D.29.) We learn from Acts 22:3 that he was the preceptor of Paul. He is generally identified with the very celebrated Jewish doctor Gamaliel, grandson of Hillel, and who is referred to as authority in the Jewish Mishna.</li></ol>",
