"G2241": "<ol><li> Eli, Eli, lama sabachthani. The Hebrew form, as Elio, Elio, etc., is the Syro-Chaldaic (the common language in use by the Jews in the time of Christ) of the first words of the twenty second Psalm; they mean &quot;My God, My God, why hast thou forsaken me?&quot;</li></ol>",
"G2242": "<span class=\"literal-meaning\">Heli = &quot;ascending&quot;</span><ol><li> the father of Joseph, the husband of Mary</li></ol>",
"G2243": "<span class=\"literal-meaning\">Elijah = &quot;my God is Jehovah&quot;</span><ol><li> a prophet born at Thisbe, the unflinching champion of the theocracy in the reigns of the idolatrous kings Ahab and Ahaziah. He was taken up to heaven without dying, whence the Jews expected he would return just before the advent of the Messiah, whom he would prepare the minds of the Israelites to receive.</li></ol>",
