"G2250": "<ol><li> the day, used of the natural day, or the interval between sunrise and sunset, as distinguished from and contrasted with the night<ol><li> in the daytime</li><li> metaph., &quot;the day&quot; is regarded as the time for abstaining from indulgence, vice, crime, because acts of the sort are perpetrated at night and in darkness</li></ol><li> of the civil day, or the space of twenty four hours (thus including the night)<ol><li> Eastern usage of this term differs from our western usage. Any part of a day is counted as a whole day, hence the expression &quot;three days and three nights&quot; does not mean literally three whole days, but at least one whole day plus part of two other days.</li></ol><li> of the last day of this present age, the day Christ will return from heaven, raise the dead, hold the final judgment, and perfect his kingdom</li><li> used of time in general, i.e. the days of his life.</li></ol>",
