"G2288": "<ol><li> the death of the body<ol><li> that separation (whether natural or violent) of the soul and the body by which the life on earth is ended</li><li> with the implied idea of future misery in hell<ol><li> the power of death</li></ol><li> since the nether world, the abode of the dead, was conceived as being very dark, it is equivalent to the region of thickest darkness i.e. figuratively, a region enveloped in the darkness of ignorance and sin</li></ol><li> metaph., the loss of that life which alone is worthy of the name,<ol><li> the misery of the soul arising from sin, which begins on earth but lasts and increases after the death of the body in hell</li></ol><li> the miserable state of the wicked dead in hell</li><li> in the widest sense, death comprising all the miseries arising from sin, as well physical death as the loss of a life consecrated to God and blessed in him on earth, to be followed by wretchedness in hell</li></ol>",
