"G2333": "<span class=\"literal-meaning\">Theudas = &quot;God-given&quot;</span><ol><li> the name of an insurgent mentioned in Gamaliel's speech before the Jewish council, Acts 5:35-39, at the time of the arraignment of the apostles. He appeared, according to Luke's account, at the head of about four hundred men. He was probably one of the insurrectionary chiefs or fanatics by whom the land was overrun in the last year of Herod's reign. Josephus speaks of a Theudas who played a similar part at the time of Claudius, about A.D. 44; but the Theudas mentioned by Luke must be a different person from the one spoken of by Josephus.</li></ol>",
