"G2659": "<ol><li> a pricking, piercing</li><li> severe sorrow, extreme grief</li><li> insensibility or torpor of mind, such as extreme grief easily produces<ol><li> hence a &quot;spirit of stupor&quot;, which renders their souls torpid so insensible that they are not affected at all by the offer made them of salvation through the Messiah</li></ol></li></ol>",
