"G2721": "<ol><li> to set up against</li></ol>",
"G2722": "<ol><li> to hold back, detain, retain<ol><li> from going away</li><li> to restrain, hinder (the course or progress of)<ol><li> that which hinders, Antichrist from making his appearance</li><li> to check a ship's headway i.e. to hold or head the ship</li></ol><li> to hold fast, keep secure, keep firm possession of</li></ol><li> to get possession of, take<ol><li> to possess</li></ol></li></ol>",
