"G2726": "<ol><li> a downcast look expressive of sorrow</li><li> shame, dejection, gloom</li></ol>",
"G2727": "<ol><li> to sound towards, sound down upon, resound<ol><li> to charm with resounding sound, to fascinate</li></ol><li> to teach orally, to instruct</li><li> to inform by word of mouth<ol><li> to be orally informed</li></ol></li></ol>",
