"G3809": "<ol><li> the whole training and education of children (which relates to the cultivation of mind and morals, and employs for this purpose now commands and admonitions, now reproof and punishment) It also includes the training and care of the body</li><li> whatever in adults also cultivates the soul, esp. by correcting mistakes and curbing passions.<ol><li> instruction which aims at increasing virtue</li><li> chastisement, chastening, (of the evils with which God visits men for their amendment)</li></ol></li></ol>",
