"G3824": "<ol><li> new birth, reproduction, renewal, recreation, regeneration<ol><li> hence renovation, regeneration, the production of a new life consecrated to God, a radical change of mind for the better. The word often used to denote the restoration of a thing to its pristine state, its renovation, as a renewal or restoration of life after death</li><li> the renovation of the earth after the deluge</li><li> the renewal of the world to take place after its destruction by fire, as the Stoics taught</li><li> the signal and glorious change of all things (in heaven and earth) for the better, that restoration of the primal and perfect condition of things which existed before the fall of our first parents, which the Jews looked for in connection with the advent of the Messiah, and which Christians expected in connection with the visible return of Jesus from heaven.</li><li> other uses<ol><li> of Cicero's restoration to rank and fortune on his recall from exile</li><li> of the restoration of the Jewish nation after exile</li><li> of the recovery of knowledge by recollection</li></ol></li></ol></li></ol>",
