"G3962": "<ol><li> generator or male ancestor<ol><li> either the nearest ancestor: father of the corporeal nature, natural fathers, both parents</li><li> a more remote ancestor, the founder of a family or tribe, progenitor of a people, forefather: so Abraham is called, Jacob and David<ol><li> fathers i.e. ancestors, forefathers, founders of a nation</li></ol><li> one advanced in years, a senior</li></ol><li> metaph.<ol><li> the originator and transmitter of anything<ol><li> the authors of a family or society of persons animated by the same spirit as himself</li><li> one who has infused his own spirit into others, who actuates and governs their minds</li></ol><li> one who stands in a father's place and looks after another in a paternal way</li><li> a title of honour<ol><li> teachers, as those to whom pupils trace back the knowledge and training they have received</li><li> the members of the Sanhedrin, whose prerogative it was by virtue of the wisdom and experience in which they excelled, to take charge of the interests of others</li></ol><li> God is called the Father<ol><li> of the stars, the heavenly luminaries, because he is their creator, upholder, ruler</li><li> of all rational and intelligent beings, whether angels or men, because he is their creator, preserver, guardian and protector<ol><li> of spiritual beings and of all men</li></ol><li> of Christians, as those who through Christ have been exalted to a specially close and intimate relationship with God, and who no longer dread him as a stern judge of sinners, but revere him as their reconciled and loving Father</li><li> the Father of Jesus Christ, as one whom God has united to himself in the closest bond of love and intimacy, made acquainted with his purposes, appointed to explain and carry out among men the plan of salvation, and made to share also in his own divine nature<ol><li> by Jesus Christ himself</li><li> by the apostles</li></ol></li></ol></li></ol>",
