"G4151": "<ol><li> the third person of the triune God, the Holy Spirit, coequal, coeternal with the Father and the Son<ol><li> sometimes referred to in a way which emphasises his personality and character (the &quot;Holy&quot; Spirit)</li><li> sometimes referred to in a way which emphasises his work and power (the Spirit of &quot;Truth&quot;)</li><li> never referred to as a depersonalised force</li></ol><li> the spirit, i.e. the vital principal by which the body is animated<ol><li> the rational spirit, the power by which the human being feels, thinks, decides</li><li> the soul</li></ol><li> a spirit, i.e. a simple essence, devoid of all or at least all grosser matter, and possessed of the power of knowing, desiring, deciding, and acting<ol><li> a life giving spirit</li><li> a human soul that has left the body</li><li> a spirit higher than man but lower than God, i.e. an angel<ol><li> used of demons, or evil spirits, who were conceived as inhabiting the bodies of men</li><li> the spiritual nature of Christ, higher than the highest angels and equal to God, the divine nature of Christ</li></ol><li> the disposition or influence which fills and governs the soul of any one<ol><li> the efficient source of any power, affection, emotion, desire, etc.</li></ol><li> a movement of air (a gentle blast)<ol><li> of the wind, hence the wind itself</li><li> breath of nostrils or mouth</li></ol></li></ol>",
