"G4394": "<ol><li> prophecy<ol><li> a discourse emanating from divine inspiration and declaring the purposes of God, whether by reproving and admonishing the wicked, or comforting the afflicted, or revealing things hidden; esp. by foretelling future events</li><li> Used in the NT of the utterance of OT prophets<ol><li> of the prediction of events relating to Christ's kingdom and its speedy triumph, together with the consolations and admonitions pertaining to it, the spirit of prophecy, the divine mind, to which the prophetic faculty is due</li><li> of the endowment and speech of the Christian teachers called prophets</li><li> the gifts and utterances of these prophets, esp. of the predictions of the works of which, set apart to teach the gospel, will accomplish for the kingdom of Christ</li></ol></li></ol></li></ol>",
