"G4396": "<ol><li> in Greek writings, an interpreter of oracles or of other hidden things</li><li> one who, moved by the Spirit of God and hence his organ or spokesman, solemnly declares to men what he has received by inspiration, especially concerning future events, and in particular such as relate to the cause and kingdom of God and to human salvation<ol><li> the OT prophets, having foretold the kingdom, deeds and death, of Jesus the Messiah.</li><li> of John the Baptist, the herald of Jesus the Messiah</li><li> of the illustrious prophet, the Jews expected before the advent of the Messiah</li><li> the Messiah</li><li> of men filled with the Spirit of God, who by God's authority and command in words of weight pleads the cause of God and urges salvation of men</li><li> of prophets that appeared in the apostolic age among Christians<ol><li> they are associated with the apostles</li><li> they discerned and did what is best for the Christian cause, foretelling certain future events. (Acts 11:27)</li><li> in the religious assemblies of the Christians, they were moved by the Holy Spirit to speak, having power to instruct, comfort, encourage, rebuke, convict, and stimulate, their hearers</li></ol><li> a poet (because poets were believed to sing under divine inspiration)<ol><li> of Epimenides (Tit. 1:12)</li></ol></li></ol>",
