"G4678": "<ol><li> wisdom, broad and full of intelligence; used of the knowledge of very diverse matters<ol><li> the wisdom which belongs to men<ol><li> spec. the varied knowledge of things human and divine, acquired by acuteness and experience, and summed up in maxims and proverbs</li><li> the science and learning</li><li> the act of interpreting dreams and always giving the sagest advice</li><li> the intelligence evinced in discovering the meaning of some mysterious number or vision</li><li> skill in the management of affairs</li><li> devout and proper prudence in intercourse with men not disciples of Christ, skill and discretion in imparting Christian truth</li><li> the knowledge and practice of the requisites for godly and upright living</li></ol><li> supreme intelligence, such as belongs to God<ol><li> to Christ</li><li> the wisdom of God as evinced in forming and executing counsels in the formation and government of the world and the scriptures</li></ol></li></ol></li></ol>",
