"G4690": "<ol><li> from which a plant germinates<ol><li> the seed i.e. the grain or kernel which contains within itself the germ of the future plants<ol><li> of the grains or kernels sown</li></ol><li> metaph. a seed i.e. a residue, or a few survivors reserved as the germ of the next generation (just as seed is kept from the harvest for the sowing)</li></ol><li> the semen virile<ol><li> the product of this semen, seed, children, offspring, progeny</li><li> family, tribe, posterity</li><li> whatever possesses vital force or life giving power<ol><li> of divine energy of the Holy Spirit operating within the soul by which we are regenerated</li></ol></li></ol></li></ol>",
"G4691": "<ol><li> picking up seed<ol><li> of birds, esp. of the crow or daw that picks up grain in fields</li></ol><li> metaph.<ol><li> lounging about the market place and picking up a substance by whatever may chance to fall from the loads of merchandise</li><li> hence, beggarly, abject, vile, (a parasite)</li><li> getting a living by flattery and bufferoonery</li><li> an empty talker, babbler</li></ol></li></ol>",
