"G4716": "<ol><li> a cross<ol><li> a well known instrument of most cruel and ignominious punishment, borrowed by the Greeks and Romans from the Phoenicians; to it were affixed among the Romans, down to the time of Constantine the Great, the guiltiest criminals, particularly the basest slaves, robbers, the authors and abetters of insurrections, and occasionally in the provinces, at the arbitrary pleasure of the governors, upright and peaceable men also, and even Roman citizens themselves</li><li> the crucifixion which Christ underwent</li></ol><li> an upright &quot;stake&quot;, esp. a pointed one, used as such in fences or palisades</li></ol>",
